### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Linear Algebra**
- **Matrices and Determinants**
  - Properties of square matrices: \( A^2 - A = 0 \)
  - Determinant properties: \(\det(A)\)
  - Adjugate and inverse matrices: \( A \text{adj}(A) = \det(A)I \)
  - Scalar matrices: \( AB - BA = 0 \) for scalar matrix \( B \)

- **Vector Spaces**
  - Definition and properties of vector spaces
  - Subspaces and their dimensions
  - Span and linear independence
  - Basis and dimension of vector spaces

- **Linear Transformations**
  - Addition and scalar multiplication in vector spaces
  - Properties of linear transformations

#### 2. **Probability and Markov Chains**
- **Transition Matrices**
  - Transition probabilities and state transitions
  - Distribution vectors and their evolution over time
  - Steady-state distributions and equilibrium

- **Matrix Operations**
  - Matrix multiplication and transposition
  - Reduced row echelon form and its properties

#### 3. **Equations and Formulas**
- **Matrix Equations**
  - \( A^2 - A = 0 \)
  - \( A \text{adj}(A) = \det(A)I \)
  - \( P^T X_{n-1} = X_n \) for Markov chains

- **Vector Space Equations**
  - Addition: \( (x_1, y_1) + (x_2, y_2) = (x_1 + x_2, y_1 + y_2) \)
  - Scalar multiplication: \( c(x, y) = (cx, cy) \)

- **Determinant and Adjugate**
  - \( \det(\text{adj}(A)) = \det(A)^{n-1} \) for an \( n \times n \) matrix \( A \)

